import React from 'react';
import { AppBar, Toolbar, Typography, makeStyles, Button } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: 'white', // White background color
    position: 'sticky', // To make it stick to the top
    top: 0, // To make it touch the very top
  },
  logo: {
    flexGrow: 1, // To make the logo span the entire width
    color: 'black', // Black color for logo text
    textDecoration: 'none',
  },
  navLinks: {
    '& > *': {
      color: 'black', // Black color for links
      marginRight: theme.spacing(2),
      textDecoration: 'none',
    },
  },
}));

const NavBar = () => {
  const classes = useStyles();

  return (
    <AppBar className={classes.appBar}>
      <Toolbar>
        <Typography variant="h6" className={classes.logo}>
          Jack R
        </Typography>
        <div className={classes.navLinks}>
          <Button href="#about">About</Button>
          <Button href="#experience">Experience</Button>
          <Button href="#projects">Projects</Button>
          <Button href="#contact">Contact</Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default NavBar;
